#分区间统计
def statistics(detected):
    # 对检测到的目标进行统计
    # 分区间进行统计 统计10以下 10-50 50-100 100-1000 1000m以上的数量
    # 转换为km单位
    sum1 = 0
    sum2 = 0
    sum3 = 0
    sum4 = 0
    sum5 = 0
    #保存各个区间的统计数量
    for i in detected:
        if i <= 0.03:
            sum1 += 1
        elif i > 0.03 and i <= 0.1:
            sum2 += 1
        elif i > 0.1 and i <= 0.3:
            sum3 += 1
        elif i > 0.3 and i <= 1:
            sum4 += 1
        else:
            sum5 += 1
    res = [sum1,sum2,sum3,sum4,sum5]
    return res

def D(detected):
    # 找出id对应的H并计算出D的值
    # 总数据统计 H_0
    # 检测列表数据统计 H_detected
    with open('E:/Python/NEA/Soft03Unusual_expansion_sorted.txt','r') as f:
        H_0 = []
        H_detected = []
        # 读取小行星轨道根数数据
        data_0 = f.readlines()
        for line in data_0:
            tmp = line.split(',')
            H_0.append(float(tmp[11]))
            if tmp[0] in detected:
                H_detected.append(float(tmp[11]))

    from D_H import H2D
    D_origin = H2D(H_0)
    D_detected = H2D(H_detected)
    #返回总数的统计和检测列表的统计
    return [D_origin,D_detected]

